// routes.js 또는 App.js에서 라우팅 설정을 진행합니다.
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import LandingPage from './pages/LandingPage';
import LoginPage from './pages/LoginPage';
import SigninPage from './pages/SigninPage';
import MvchoPage from './pages/MvchoPage';
import RecomPage from './pages/RecomPage';
import MvdetailPage from './pages/MvdetailPage';
import MyPage from './pages/MyPage'; // 마이페이지 부모 컴포넌트
import MyalrPage from './pages/MyalrPage';
import MywishPage from './pages/MywishPage';
import MycalPage from './pages/MycalPage';
import MvsrchPage from './pages/MvsrchPage'; // 검색 페이지

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="login" element={<LoginPage />} />
        <Route path="signin" element={<SigninPage />} />
        <Route path="movie-select" element={<MvchoPage />} />
        <Route path="recommendations" element={<RecomPage />} />
        <Route path="movie/:id" element={<MvdetailPage />} />
        <Route path="movie-search" element={<MvsrchPage />} /> {/* 검색 페이지 */}
        <Route path="my" element={<MyPage />}> {/* 마이페이지 및 자식 라우트 */}
          <Route path="watched" element={<MyalrPage />} />
          <Route path="wishlist" element={<MywishPage />} />
          <Route path="calendar" element={<MycalPage />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
